          y ademas que agregen valor a los productos y servicios que brinda actualmente de modo que podamos llegar al objetivo trazado.
        </p>

      </div>

      <div className="dib measure  ">
          <p className="f4-l f3 fw1 white tracked-tight">
            <span className="f3-l pointer f5 tracked-tight dib bg-animate hover-bg-red hover-white no-underline pv3 ph6-l ph5 br2 ba boton-bg border-col white ">CONOCENOS MAS</span>
          </p>
      </div>


      <div className="w-80-l tr">
        <img className="pa3" src={text869} alt=""/>
      </div>



    </div>
  </div>


);
}

export default Nosotros;
